class NotFound extends Component{
    render(){
        return(
            <div style={{display:'flex',width:'100vw',height:'100vh',justifyContent:'center',alignItems:'center'}}>
                        <h1>404 PAGE NOT FOUND</h1>
            </div>

        )
    }

}

export default NotFound;
